<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">

    <style>
        @import url('https://fonts.googleapis.com/css2?family=Roboto:wght@400;500;700&display=swap');
        body { font-family: 'Roboto', sans-serif; background-color: #f4f7f9; margin: 0; padding: 20px; display: flex; justify-content: center; }
        .container { background-color: #fff; padding: 25px 30px; border-radius: 12px; box-shadow: 0 5px 20px rgba(0, 0, 0, 0.1); max-width: 800px; width: 100%; }
        h1 { color: #003366; text-align: center; margin-top: 0; margin-bottom: 25px; }
        .form-grid { display: grid; grid-template-columns: 1fr 1fr; gap: 20px; }
        .form-group { margin-bottom: 0; display: flex; flex-direction: column; }
        .full-width { grid-column: 1 / -1; }
        label { display: block; font-weight: 600; color: #333; margin-bottom: 8px; }
        input[type="number"], select { width: 100%; padding: 12px; border: 1px solid #ccc; border-radius: 6px; font-size: 16px; box-sizing: border-box; transition: border-color 0.3s; }
        input[type="number"]:focus, select:focus { border-color: #e77817; outline: none; }
        button { width: 100%; padding: 14px; background: linear-gradient(45deg, #007bff, #0056b3); color: white; border: none; border-radius: 6px; font-size: 18px; font-weight: bold; cursor: pointer; transition: transform 0.2s; margin-top: 10px; }
        button:hover { transform: translateY(-2px); }
        #results { margin-top: 30px; display: none; border-top: 2px solid #e9ecef; padding-top: 20px; }
        #summary-card { padding: 15px; background-color: #e9f5ff; border: 1px solid #b3d7ff; border-radius: 8px; margin-bottom: 20px; }
        #summary-card p { margin: 5px 0; display: flex; justify-content: space-between; font-weight: 500;}
        #summary-card p span { font-weight: bold; color: #0056b3; }
        .results-grid { display: grid; grid-template-columns: repeat(auto-fit, minmax(250px, 1fr)); gap: 15px; }
        .result-card { background-color: #f8f9fa; padding: 20px; border-radius: 8px; border-left: 5px solid #007bff; }
        .result-card h3 { margin-top: 0; color: #007bff; font-size: 1.1rem; border-bottom: 1px solid #dee2e6; padding-bottom: 10px; margin-bottom: 15px; }
        .result-card p { margin: 8px 0; font-size: 1rem; color: #555; display: flex; justify-content: space-between; }
        .result-card p span { font-weight: bold; color: #333; }
        #error-message { color: #d93025; background-color: #f8d7da; border: 1px solid #f5c6cb; padding: 12px; border-radius: 6px; margin-top: 20px; display: none; text-align: center; font-weight: 500; }
        @media (max-width: 600px) { .form-grid { grid-template-columns: 1fr; } }
    </style>
</head>
<body>

<div class="container">
    <h1>LIC New Jeevan Shanti (Plan 858)</h1>

    <form id="pension-form" onsubmit="calculateAnnuity(); return false;">
        <div class="form-grid">
            <div class="form-group full-width">
                <label for="life-option">Annuity Option</label>

            </div>
            <div class="form-group">
                <label for="deferment-period">Deferment Period (1-5 Years)</label>
                <input type="number" id="deferment-period" value="5" min="1" max="5" required>
            </div>
            <div class="form-group">
                <label for="age">Primary Annuitant Age (30-79)</label>
                <input type="number" id="age" value="50" min="30" max="79" required>
            </div>
            <div class="form-group" id="joint-life-age-group" style="display:none;">
                <label for="j-age">Secondary Annuitant Age (30-79)</label>
                <input type="number" id="j-age" value="45" min="30" max="79">
            </div>
            <div class="form-group full-width">
                <button type="submit">Calculate Pension</button>
            </div>
        </div>
    </form>
    <div id="error-message"></div>
    <div id="results">
        <div id="summary-card"></div>
        <div id="pension-results" class="results-grid"></div>

</div>

function toggleJointLifeAge() {
    const lifeOption = document.getElementById('life-option').value;
    document.getElementById('joint-life-age-group').style.display = (lifeOption === 'joint') ? 'flex' : 'none';
}

function calculateAnnuity() {
    const errorDiv = document.getElementById('error-message');
    const resultsDiv = document.getElementById('results');
    const pensionResultsDiv = document.getElementById('pension-results');
    errorDiv.style.display = 'none';
    resultsDiv.style.display = 'none';

    // 1. Get User Inputs
    const lifeOption = document.getElementById('life-option').value;
    const purchasePriceExclGst = parseInt(document.getElementById('purchase-price').value);
    const age = parseInt(document.getElementById('age').value);
    const jointAge = parseInt(document.getElementById('j-age').value);
    const defermentPeriod = parseInt(document.getElementById('deferment-period').value);
    
    // 2. Validation
    if (isNaN(purchasePriceExclGst) || isNaN(age) || isNaN(defermentPeriod) || (lifeOption === 'joint' && isNaN(jointAge))) {
        return displayError("Please fill all fields with valid numbers.");
    }
    if (purchasePriceExclGst < 150000) return displayError("Minimum Purchase Price is â‚¹1,50,000.");
    if (age < 30 || age > 79 || (lifeOption === 'joint' && (jointAge < 30 || jointAge > 79))) {
        return displayError("Age of annuitants must be between 30 and 79.");
    }
    if (age + defermentPeriod > 80 || (lifeOption === 'joint' && jointAge + defermentPeriod > 80)) {
        return displayError("Vesting Age (Age + Deferment) cannot exceed 80.");
    }

    // 3. Get Base Annuity Rate using the CORRECT key logic
    const baseAnnuityRate = getBaseAnnuityRate(lifeOption, age, jointAge, defermentPeriod);
    if (baseAnnuityRate === null) return displayError("This combination is not available. Please check the rate tables.");

    // 4. *** THE DEFINITIVE, CORRECTED CALCULATION FLOW ***
    
    // Step A: Calculate GST on the base purchase price.
    const gstAmount = purchasePriceExclGst * 0.018;
    const totalOutlay = purchasePriceExclGst + gstAmount;

    // Step B: Get the incentive rate (returns 0 if price is < 5 Lakhs).
    const incentiveRate = getPurchasePriceIncentive(purchasePriceExclGst);
    
    // Step C: Add the incentive to the base rate to get the final applicable rate.
    const finalAnnuityRate = baseAnnuityRate + incentiveRate;

    // Step D: Calculate the Annual Pension on the PRICE EXCLUDING GST.
    // This is the primary fix for the large discrepancy.
    const annualPension = (purchasePriceExclGst / 1000) * finalAnnuityRate;

    // Step E: Calculate pension for all modes using the correct reduction factors.
    const pensionModes = {
        yearly:     annualPension,
        halfYearly: annualPension * (1 - 0.02), // 2% reduction
        quarterly:  annualPension * (1 - 0.03), // 3% reduction
        monthly:    annualPension * (1 - 0.04)  // 4% reduction
    };

    // 5. Display Results
    document.getElementById('summary-card').innerHTML = `
        <p>Purchase Price: <span>${formatInr(purchasePriceExclGst)}</span></p>
        <p>GST (1.8%): <span>+ ${formatInr(gstAmount)}</span></p>
        <p>Total Outlay: <span>${formatInr(totalOutlay)}</span></p>
    `;
    
    pensionResultsDiv.innerHTML = `
        <div class="result-card">
            <h3>Yearly Pension</h3>
            <p>Pension Amount: <span>${formatInr(pensionModes.yearly)}</span></p>
        </div>
        <div class="result-card">
            <h3>Half-Yearly Pension</h3>
            <p>Pension Amount: <span>${formatInr(pensionModes.halfYearly / 2)}</span></p>
        </div>
        <div class="result-card">
            <h3>Quarterly Pension</h3>
            <p>Pension Amount: <span>${formatInr(pensionModes.quarterly / 4)}</span></p>
        </div>
        <div class="result-card">
            <h3>Monthly Pension</h3>
            <p>Pension Amount: <span>${formatInr(pensionModes.monthly / 12)}</span></p>
        </div>
    `;
    resultsDiv.style.display = 'block';
}

function displayError(message) {
    const errorDiv = document.getElementById('error-message');
    errorDiv.textContent = message;
    errorDiv.style.display = 'block';
    document.getElementById('results').style.display = 'none';
}

// --- HELPER FUNCTIONS FOR PLAN 858 ---
function getBaseAnnuityRate(lifeOption, age, jointAge, deferment) {
    try {
        if (lifeOption === 'single') {
            if (!singleLifeData || singleLifeData.length === 0) return null;
            const ageData = singleLifeData.find(row => row.Age === age);
            if (!ageData) return null;
            
            // *** THIS IS THE CORRECTED LOGIC ***
            // The key in your new JSON is simply 'T' plus the deferment period.
            const defermentKey = `T${deferment}`;

            const rate = ageData[defermentKey];
            return (rate && rate > 0) ? rate : null;

        } else { // Joint Life
            if (!jointLifeData || jointLifeData.length === 0) return null;
            const rateData = jointLifeData.find(row => 
                row.Age === age && 
                row.Jage === jointAge && 
                row.DF === deferment
            );
            return rateData ? rateData.Tbp : null;
        }
    } catch (e) {
        return null;
    }
}

function getPurchasePriceIncentive(priceExclGst) {
    // This is correct: The incentive is only for purchase prices of 5 Lakhs and above.
    if (priceExclGst >= 10000000) return 2.70;
    if (priceExclGst >= 5000000)  return 2.60;
    if (priceExclGst >= 2500000)  return 5.00;
    if (priceExclGst >= 1000000)  return 2.60;
    if (priceExclGst >= 500000)   return 1.50;
    
    // For any amount below 5 Lakhs (like 1.5 Lakhs), no incentive is given.
    return 0;
}

function formatInr(amount) {
    return new Intl.NumberFormat('en-IN', {
        style: 'currency', currency: 'INR', maximumFractionDigits: 0
    }).format(Math.round(amount));
}
